import React from 'react'
import clrSVG from './Vector.svg'

function ClarIco({color, size, className}) {

    return(
      <svg className={`${className}`} fill={color} stroke={color} width={size} height={size}>
        <use xlinkHref={`${clrSVG}`} />
      </svg>
    )
  }
  
  export default ClarIco;
